const tasks = [
    {
        id: 1,
        text: 'Docters Appointment',
        day: 'Feb 5th at 2:30pm',
        reminder: true,
    },
    {
        id: 2,
        text: 'Meeting at school',
        day: 'Feb 6th at 2:30pm',
        reminder: true,
    },
    {
        id: 3,
        text: 'Shopping',
        day: 'Feb 5th at 2:30pm',
        reminder: false,
    }
]
 
const Tasks = () => {
   return (
     <>{
        tasks.map((task) => (
        <h3>{task.text}</h3>
     ))}</>
   )
 }
 
 export default Tasks;
